package icehs.science.chapter04;

public class RelationalOperatorEx {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int n1=10,n2=3,n3=3;
		System.out.println(n1>n2);
		System.out.println(n1<n2);
		System.out.println(n1>=n2);
		System.out.println(n1<=n2);
		System.out.println(n2>=n3);
		System.out.println(n1==n2);
		System.out.println(n2==n3);
		System.out.println(n1!=n2);
		System.out.println(n2!=n3);
	}

}
